           ['Uncommon',
            [['Eye',
              u'N\xe4thinneruptur*, \u201dflare\u201d i fr\xe4mre \xf6gonkammaren* * Biverkningar som anses ha samband med den intravitreala injektionsproceduren snarare \xe4n dexametasonimplantatet c) Det f\xf6rh\xf6jda intraokul\xe4ra trycket (IOP) med OZURDEX n\xe5dde det h\xf6gsta v\xe4rdet dag 60 och hade \xe5terg\xe5tt till ursprungsniv\xe5erna dag 180. F\xf6rh\xf6jt intraokul\xe4rt tryck kr\xe4vde antingen ingen behandling eller kunde \xe5tg\xe4rdas genom tillf\xe4llig anv\xe4ndning av topikala IOP-s\xe4nkande l\xe4kemedel. Under den inledande behandlingsperioden beh\xf6vde 0,7 % (3/421) av patienterna som fick OZURDEX behandlas med antingen laser eller kirurgi f\xf6r att kontrollera det f\xf6rh\xf6jda \xf6gontrycket i det \xf6ga som studerades, j\xe4mf\xf6rt med 0,2 % (1/423) av patienterna som fick placebo. Biverkningsprofilen hos de 341 patienter som analyserades efter en andra injektion av OZURDEX liknade den efter den f\xf6rsta injektionen. Totalt fick 54 % av patienterna minst en biverkning. Incidensen av f\xf6rh\xf6jt IOP (24,9 %) var n\xe4stan densamma som s\xe5gs efter den f\xf6rsta injektionen och \xe5tergick p\xe5 samma s\xe4tt till ursprungsv\xe4rdet vid dag 180 i den \xf6ppna studien. Totalincidensen av katarakt var h\xf6gre efter 1 \xe5r j\xe4mf\xf6rt med under de f\xf6rsta 6 m\xe5naderna. Uveit a) Den kliniska s\xe4kerheten hos OZURDEX f\xf6r patienter med inflammation i \xf6gats bakre segment i form av icke-infekti\xf6s uveit har bed\xf6mts i en blind, randomiserad multicenterstudie. Totalt 77 patienter randomiserades till att f\xe5 OZURDEX och 76 till att f\xe5 placebo. Totalt 73 (95 %) av de patienter som randomiserats till och behandlats med OZURDEX fullf\xf6ljde den 26 veckor l\xe5nga studien. De vanligaste rapporterade biverkningarna i det studerade \xf6gat hos patienter som fick OZURDEX var konjunktivalbl\xf6dning (30,3 %), f\xf6rh\xf6jt intraokul\xe4rt tryck (25,0 %) och katarakt (11,8 %). b) F\xf6ljande biverkningar, som bed\xf6mdes ha samband med OZURDEX-behandlingen, rapporterades under den kliniska fas III-studien.']]],
